import { Navigate, Outlet, Route, Routes } from "react-router-dom";
import { PageTitle } from "../../../../_metronic/layout/core";
import { CapNhatHoSo } from "./danh-sach-ho-so/CapNhatHoSo";
import { DanhSachHoSo } from "./danh-sach-ho-so/DanhSachHoSo";
import { ThemHoSo } from "./danh-sach-ho-so/ThemHoSo";

const usersBreadcrumbs = [
  {
    title: "Nộp hồ sơ",
    path: "/admin/nop-ho-so/danh-sach-ho-so",
    isSeparator: false,
    isActive: false,
  },
  {
    title: "",
    path: "",
    isSeparator: true,
    isActive: false,
  },
];

const DanhMucPage = () => {
  return (
    <Routes>
      <Route element={<Outlet />}>
        <Route
          path="danh-sach-ho-so"
          element={
            <>
              <PageTitle breadcrumbs={usersBreadcrumbs}>Nộp hồ sơ</PageTitle>
              <DanhSachHoSo />
            </>
          }
        />
        <Route
          path="create"
          element={
            <>
              <PageTitle breadcrumbs={usersBreadcrumbs}>Thêm hồ sơ</PageTitle>
              <ThemHoSo />
            </>
          }
        />
        <Route
          path="dieuchinh/:id"
          element={
            <>
              <PageTitle breadcrumbs={usersBreadcrumbs}>
                Cập nhật hồ sơ
              </PageTitle>
              <CapNhatHoSo />
            </>
          }
        />
      </Route>
      <Route
        index
        element={<Navigate to="/admin/nop-ho-so/danh-sach-ho-so" />}
      />
    </Routes>
  );
};

export default DanhMucPage;
